                            if(quad.predicate.value == "http://www.cidoc-crm.org/cidoc-crm/P46_is_composed_of") {

                            console.log("subjekt: " + quad2.subject.value + ' predikaat: ' + quad2.predicate.value + ' objekt: ' + quad2.object.value)
                            // console.log(' objekt: ' + quad.object.value);

                        }
                        }



                    }


                }
            }//main


    main();

    return {a};
}; //inital props
export default Test
